import React from "react";
import Wrapper from "./components/Wrapper";
import Title from "./components/Title";
// import SpongeBobCard from "./components/SpongeBobCard";
// import SquidwardCard from "./components/SquidwardCard";
// import MrKrabsCard from "./components/MrKrabsCard";
import friends from "./friends.json";
import FriendCard from "./components/FriendCard/FriendCard";

function App() {
  return (
    <Wrapper>
      <Title>Friends List</Title>
      <FriendCard id={friends[0].id} name={friends[0].name} occupation={friends[0].occupation} location={friends[0].location}/>
      <FriendCard id={friends[1].id} name={friends[1].name} occupation={friends[1].occupation} location={friends[0].location}/>
      <FriendCard id={friends[2].id} name={friends[2].name} occpation={friends[2].occupation}  location={friends[0].location}/>
    </Wrapper>
  );
}

export default App;
